class Solution {
    public List<Integer> grayCode(int n) {
        if (n == 0) {
            return Stream.of(0).collect(Collectors.toList());
        }
        StringBuilder stringBuilder = new StringBuilder();
        int pow = (int) Math.pow(2, n);
        for (int i = 0; i < n; i++) {
            stringBuilder.append('0');
        }
        Set<String> set = new HashSet<>();
        List<Integer> list = new LinkedList<>();
        dfs(stringBuilder, 0, set, n, list, pow);
        return list;
    }

    private boolean dfs(StringBuilder stringBuilder, int index, Set<String> set, int length, List<Integer> list,
            int target) {
        if (set.contains(stringBuilder.toString())) {
            return false;
        }
        if (index >= target) {
            return true;
        }
        set.add(stringBuilder.toString());
        list.add(Integer.parseInt(stringBuilder.toString(), 2));
        for (int i = 0; i < length; i++) {
            char c = stringBuilder.charAt(i);
            char ch = c;
            if (ch == '0') {
                ch = '1';
            } else {
                ch = '0';
            }
            stringBuilder.setCharAt(i, ch);
            if (!set.contains(stringBuilder.toString())) {
                if (dfs(stringBuilder, index + 1, set, length, list, target)) {
                    return true;
                }
            }
            stringBuilder.setCharAt(i, c);
        }
        return true;
    }
}
